import React from 'react';
import { App } from './App'
import { render } from "react-dom" 
import { Grid } from './stores/grid';
import { GridView } from './components/gridView';
import './index.css';

const grid = new Grid();
grid.testGrid();

render(
    <div>
        <GridView grid={grid}/>
        <App />
    </div>
 


, document.getElementById("root"));
